import React, { Component } from 'react'

export default class DisplaySuggestions extends Component {
    render() {

        const{displaySuggestions, patientSearchResult} = this.props;
        if (!displaySuggestions) return null;

        return (

            <div className="doctor-searchBox">
                <div className="doctor-searchBox-input">
                    {
                        patientSearchResult && 
                        patientSearchResult.map((item,index)=>{
                            return(
                                <div className="doctor-searchBox-input" key={index}>
                                    {patientSearchResult.name}
                                </div>
                            )
                        })
                    }
                </div>

            </div>
        )
    }
}
